import NavApp from "./NavApp";
import Home from "../AppApi/Home";
import ConcertInformation from "../AppApi/ConcertInformation";
import MeetUs from "../AppApi/MeetUs";
import History from "../AppApi/History";
import Activity from "../AppApi/Activity";
import EduPro from "../AppApi/EduPro";
import Watching from "../AppApi/Watching";
import Donate from "../AppApi/Donate";

import { HashRouter, Routes, Route } from "react-router-dom";


function MainApp() {
  return (
    <main className="MainApp">
      <HashRouter>
        <NavApp />
      <Routes>

        <Route exact path="/" element={<Home />} />
        <Route path="/ConcertInformation" element={<ConcertInformation />} />
        <Route path="/MeetUs" element={<MeetUs />} />
        <Route path="/History" element={<History />} />
        <Route path="/Activity" element={<Activity />} />
        <Route path="/EduPro" element={<EduPro />} />
        <Route path="/Watching" element={<Watching />} />
        <Route path="/Donate" element={<Donate />} />

      </Routes>
    </HashRouter>
    </main>
  );
};

export default MainApp;
